import NavBar from '@/layout/NavbarUser.vue';
import Hello from './components/HelloWorld.vue';

const routes = [
  {
    path: '/',
    name: 'Nav',
    component: NavBar,
    children:[
      {
        path: '/',
        name: 'Hello',
        component: Hello,
      }
    ]
  },
]

export default routes
